,(6340,362,'good_soc_feed_text',''),(6341,362,'good_soc_feed_img',''),(6342,362,'good_video_link','#'),(6343,362,'good_video_text',''),(6344,362,'good_video_img',''),(6345,362,'good_video_preview',''),(6346,362,'tab_bg','321'),(6347,362,'good_tabs_description_tab','Описание'),(6348,362,'good_tabs_description_content','<h4><strong>Правильное увлажнение &mdash; залог молодости кожи</strong></h4>\r\n<h4><strong>Дневной увлажняющий крем ТМ \"Alga Ph\" не просто удерживает влагу,</strong></h4>\r\n<h4><strong>но и заставляет ее работать на кожу.</strong></h4>\r\n<p class=\"MsoNormal\"><em>Наша кожа не справляется с самоувлажнением, поскольку мы постоянно устраиваем</em></p>\r\n<p class=\"MsoNormal\"><em>ей испытания в виде центрального отопления, кондиционирования воздуха,</em></p>\r\n<p class=\"MsoNormal\"><em>уличной пыли и смога, ветра, перепада низких и высоких температур...</em></p>\r\n<p class=\"MsoNormal\">Активные ингредиенты в составе увлажняющего крема Alga Ph притягивают влагу</p>\r\n<p class=\"MsoNormal\">и передают ее клеткам кожи. Также они создают гидрофильную пленку, которая</p>\r\n<p class=\"MsoNormal\">замедляет процесс испарение влаги и усиливает защитный барьер эпидермиса.</p>\r\n<p class=\"MsoNormal\">Когда кожа хорошо увлажнена, ее защитные функции повышаются, она легко</p>\r\n<p class=\"MsoNormal\">справляется с воздействием окружающей среды, выглядит свежей и красивой.</p>\r\n<p class=\"MsoNormal\"><strong>Результаты:</strong></p>\r\n<p class=\"MsoNormal\">- кожа более мягкая, гладкая и отдохнувшая &ndash; 93%</p>\r\n<p class=\"MsoNormal\">- кожа выглядит моложе &ndash; 71%</p>\r\n<p class=\"MsoNormal\">- кожа становится боле упругой &ndash; 73%</p>\r\n<p class=\"MsoNormal\">* По результатам потребительского тестирования, подводимого в течении 6 недель</p>\r\n<p class=\"MsoNormal\">с участием 52 женщин, использовавших Дневной крем Alga Ph.</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>'),(6349,362,'good_tabs_ingredients_tab','Состав'),(6350,362,'good_tabs_ingredients_content','<p><strong>Соста крема:</strong></p>\r\n<p>- гидролат алоэ вера</p>\r\n<p>- OLIVEM 1000</p>\r\n<p>- масло сливовых косточек</p>\r\n<p>- масло алоэ</p>\r\n<p>- масло бораго (огуречника)</p>\r\n<p>- комбучка</p>\r\n<p>- глицерин</p>\r\n<p>- масло ши</p>\r\n<p>- масло рыжиковое</p>\r\n<p>- экстракт зеленого чая</p>\r\n<p>- витамины Е и F</p>\r\n<p>- Д-пантенол</p>\r\n<p>- воск карнаубский</p>\r\n<p>- Euxyl PE 9010</p>\r\n<p>&nbsp;</p>'),(6351,362,'good_tabs_usage_tab','Применение'),(6352,362,'good_tabs_usage_content','<p><strong>Способ нанесения:</strong></p>\r\n<p>Крем наносится нежными массажными движениями, на очищенную, слегка влажную кожу лица</p>\r\n<p>и нижнюю линию шеи, по направлению массажных линий: от центра лица к краям,</p>\r\n<p>то есть от носа к щекам и от центра лба к вискам. Закончить нанесение крема можно легкими</p>\r\n<p>похлопывающими движениями.</p>\r\n<p>Ежедневное использование <strong>Crema Viso Da Giorno</strong> сделает кожу более эластичной и гладкой.</p>'),(6353,362,'_edit_lock','1540559677:1'),(6354,362,'_edit_last','1'),(6374,364,'_sku',''),(6375,364,'_regular_price','735'),(6376,364,'_sale_price',''),(6377,364,'_sale_price_dates_from',''),(6378,364,'_sale_price_dates_to',''),(6379,364,'total_sales','9'),(6380,364,'_tax_status','taxable'),(6381,364,'_tax_class',''),(6382,364,'_manage_stock','no'),(6383,364,'_backorders','no'),(6384,364,'_sold_individually','no'),(6385,364,'_weight',''),(6386,364,'_length',''),(6387,364,'_width',''),(6388,364,'_height',''),(6389,364,'_upsell_ids','a:0:{}'),(6390,364,'_crosssell_ids','a:0:{}'),(6391,364,'_purchase_note',''),(6392,364,'_default_attributes','a:0:{}'),(6393,364,'_virtual','no'),(6394,364,'_downloadable','no'),(6395,364,'_product_image_gallery',''),(6396,364,'_download_limit','-1'),(6397,364,'_download_expiry','-1'),(6399,364,'_stock',NULL),(6400,364,'_stock_status','instock'),(6401,364,'_wc_averag