рживает влагу, но и заставляет ее работать на кожу. \r\nКрем притягивают влагу извне, замедляют процесс ее испарения и усиливают защитный барьер эпидермиса.'),(22496,98,'good_logo','787'),(22497,98,'good_label','722'),(22498,98,'good_soc_feed_link','https://www.facebook.com/MyLPGBody/'),(22499,98,'good_soc_feed_text','Отзыв'),(22500,98,'good_soc_feed_img','756'),(22501,98,'good_video_link','https://www.youtube.com/watch?v=nCkpzqqog4k&start_radio=1&list=RDnCkpzqqog4k'),(22502,98,'good_video_text','Видообзор'),(22503,98,'good_video_img','113'),(22504,98,'good_video_preview',''),(22505,98,'tab_bg','321'),(22506,98,'good_tabs_description_tab','Описание'),(22507,98,'good_tabs_description_content','<h4><strong>Правильное увлажнение — залог молодости кожи</strong></h4><h4><strong>Дневной увлажняющий крем ТМ \"Alga Ph\" не просто удерживает влагу,</strong></h4><h4><strong>но и заставляет ее работать на кожу.</strong></h4><p class=\"MsoNormal\"><em>Наша кожа не справляется с самоувлажнением, поскольку мы постоянно устраиваем</em></p><p class=\"MsoNormal\"><em>ей испытания в виде центрального отопления, кондиционирования воздуха,</em></p><p class=\"MsoNormal\"><em>уличной пыли и смога, ветра, перепада низких и высоких температур...</em></p><p class=\"MsoNormal\">Активные ингредиенты в составе увлажняющего крема Alga Ph притягивают влагу</p><p class=\"MsoNormal\">и передают ее клеткам кожи. Также они создают гидрофильную пленку, которая</p><p class=\"MsoNormal\">замедляет процесс испарение влаги и усиливает защитный барьер эпидермиса.</p><p class=\"MsoNormal\">Когда кожа хорошо увлажнена, ее защитные функции повышаются, она легко</p><p class=\"MsoNormal\">справляется с воздействием окружающей среды, выглядит свежей и красивой.</p><p class=\"MsoNormal\"><strong>Результаты:</strong></p><p class=\"MsoNormal\">- кожа более мягкая, гладкая и отдохнувшая – 93%</p><p class=\"MsoNormal\">- кожа выглядит моложе – 71%</p><p class=\"MsoNormal\">- кожа становится боле упругой – 73%</p><p class=\"MsoNormal\">* По результатам потребительского тестирования, подводимого в течении 6 недель</p><p class=\"MsoNormal\">с участием 52 женщин, использовавших Дневной крем Alga Ph.</p><p class=\"MsoNormal\"> </p><p class=\"MsoNormal\"> </p><p class=\"MsoNormal\"> </p>'),(22508,98,'good_tabs_ingredients_tab','Состав'),(22509,98,'good_tabs_ingredients_content','<p><strong>Соста крема:</strong></p><p>- гидролат алоэ вера</p><p>- OLIVEM 1000</p><p>- масло сливовых косточек</p><p>- масло алоэ</p><p>- масло бораго (огуречника)</p><p>- комбучка</p><p>- глицерин</p><p>- масло ши</p><p>- масло рыжиковое</p><p>- экстракт зеленого чая</p><p>- витамины Е и F</p><p>- Д-пантенол</p><p>- воск карнаубский</p><p>- Euxyl PE 9010</p><p>&nbsp;</p>'),(22510,98,'good_tabs_usage_tab','Применение'),(22511,98,'good_tabs_usage_content','<p><strong>Способ нанесения:</strong></p><p>Крем наносится нежными массажными движениями, на очищенную, слегка влажную кожу лица</p><p>и нижнюю линию шеи, по направлению массажных линий: от центра лица к краям,</p><p>то есть от носа к щекам и от центра лба к вискам. Закончить нанесение крема можно легкими</p><p>похлопывающими движениями.</p><p>Ежедневное использование <strong>Crema Viso Da Giorno</strong> сделает кожу более эластичной и гладкой.</p>'),(22645,941,'_wc_review_count','0'),(22646,941,'_wc_rating_count','a:0:{}'),(22647,941,'_wc_average_rating','0'),(22648,941,'_edit_lock','1544824668:1'),(22649,941,'_edit_last','1'),(22672,941,'_sku',''),(22673,941,'_regular_price','115'),(22674,941,'_sale_price',''),(22675,941,'_sale_price_dates_from',''),(22676,941,'_sale_price_dates_to',''),(22677,941,'total_sales','4'),(22678,941,'_tax_status','taxable'),(22679,941,'_tax_class',''),(22680,941,'_manage_stock','no'),(22681,941,'_backorders','no'),(22682,941,'_sold_individually','no'),(22683,941,'_weight',''),(22684,941,'_length',''),(22685,941,'_width',''),(22686,941,'_height',''),(22687,941,'_upsell_ids','a:0:{}'),(22688,941,'_crosssell_ids','a:0:{}'),(2268