ами.'),(23357,73,'good_logo','787'),(23358,73,'good_label','723'),(23359,73,'good_soc_feed_link',''),(23360,73,'good_soc_feed_text',''),(23361,73,'good_soc_feed_img',''),(23362,73,'good_video_link','https://www.youtube.com/watch?v=PUdyuKaGQd4&list=PLKvfh5VvSr3izJf9kAJxL0YHgG5-NbKAk&index=5'),(23363,73,'good_video_text','Видеообзор'),(23364,73,'good_video_img','113'),(23365,73,'good_video_preview','607'),(23366,73,'tab_bg','326'),(23367,73,'good_tabs_description_tab','Описание'),(23368,73,'good_tabs_description_content','<p style=\"text-align: left;\" align=\"center\"><strong>Сбалансированное питание залог здоровья кожи</strong></p><p style=\"text-align: left;\" align=\"center\"><strong>Благодаря своим органическим компонентам, ночной питательный крем Alga Ph,</strong></p><p style=\"text-align: left;\" align=\"center\"><strong> обеспечивает коже максимально здоровое природное питание.</strong></p><p style=\"text-align: left;\"><em>В повседневной жизни наша кожа нуждается в правильном сбалансированном питании.</em></p><p style=\"text-align: left;\"><em> Его недостаток часто приводит к шелушению, исчезновению здорового румянца,</em></p><p style=\"text-align: left;\"><em>увяданию и чрезмерной сухости эпидермиса. Особенно ярко это проявляется</em></p><p style=\"text-align: left;\"><em>в зимний период и при смене пор года.</em></p><p style=\"text-align: left;\">Помимо увлажнения он насыщает кожу минералами, витаминами, аминокислотами и протеинами.</p><p style=\"text-align: left;\">Также крем защищает кожу от воздействия низких температур (сильного ветра, морозов, снега),</p><p style=\"text-align: left;\">заживляет ранки и микроповреждения. Кроме того органическая структура крема является</p><p style=\"text-align: left;\">стимулятором обменных и регенерирующих процессов в клетках кожи.</p><p style=\"text-align: left;\"><strong>Результаты:</strong></p><p style=\"text-align: left;\">- более здоровый цвет лица – 91%</p><p style=\"text-align: left;\">- разгладились мелкие морщинки – 68%</p><p style=\"text-align: left;\">- исчезло раздражение на коже – 74%</p><p style=\"text-align: left;\">* По результатам потребительского тестирования, подводимого в течении 6 недель </p><p style=\"text-align: left;\">участием 52 женщин, использовавших Ночной крем Alga Ph.</p><p style=\"text-align: left;\"> </p><p style=\"text-align: left;\"> </p><p style=\"text-align: left;\"> </p>'),(23369,73,'good_tabs_ingredients_tab','Состав'),(23370,73,'good_tabs_ingredients_content','<p style=\"text-align: left;\"><strong>Состав крема:</strong></p><p style=\"text-align: left;\">- гидролат черной смородины</p><p style=\"text-align: left;\">- OLIVEM 1000</p><p style=\"text-align: left;\">- масло ши</p><p style=\"text-align: left;\">- масло алоэ</p><p style=\"text-align: left;\">- масло касторовое</p><p style=\"text-align: left;\">- масло черной смородины</p><p style=\"text-align: left;\">- масло примулы вечерней</p><p style=\"text-align: left;\">- экстракт моркови</p><p style=\"text-align: left;\">- гидролизат коллагена 50%</p><p style=\"text-align: left;\">- масло алоэ баттер</p><p style=\"text-align: left;\">- воск пчелиный</p><p style=\"text-align: left;\">- комплекс витаминов А, Е, F</p><p style=\"text-align: left;\">- Д-пантенол</p><p style=\"text-align: left;\">- Euxyl PE 9010</p><p style=\"text-align: left;\"> </p>'),(23371,73,'good_tabs_usage_tab','Применение'),(23372,73,'good_tabs_usage_content','<p style=\"text-align: left;\"><strong>Способ нанесения:</strong></p><p style=\"text-align: left;\">Крем наносится нежными массажными движениями, на очищенную, слегка влажную кожу лица</p><p style=\"text-align: left;\">и нижнюю линию шеи, по направлению массажных линий: от центра лица к краям,</p><p style=\"text-align: left;\">то есть от носа к щекам и от центра лба к вискам. Закончить нанесение крема можно</p><p style=\"text-align: left;\">легкими похлопывающими движениями.</p><p style=\"text-align: left;\">Ежедневное использование <strong><span lang=\"EN-US\">Crema</span> <span lang=\"EN-US\">Viso</span> <span lang=\"EN-US\">Da</span> <span lang=\"EN-US\">Notte</span></strong> придаст коже здоровый внешний вид</p><p style=\"text-align: left;\">и защитит от пагубного воздействия внешних факторов.</p><p style=\"text-align: left;\"> </p><p style=\"text-align: left;\"> </p><p style=\"text-align: left;\"> </p>'),(23376,963,'_edit_lock','1540383333:1'),(23377,963,'_edit_last','1'),(23378,965,'_wp_attached_file','2018/10/pcc-GreenPuzzle-natural-cosmetics-OG.jpg'),(23379,965,'_wp_attachment_metadata','a:5:{s:5:\"width\";i:1200;s:6:\"height\";i:628;s:4:\"file\";s:48:\"2018/10/pcc-GreenPuzzle-natural-cosmetics-OG.jpg\";s:5:\"sizes\";a:11:{s:9:\"thumbnail\";a:4:{s:4:\"file\";s:47:\"pcc-GreenPuzzle-natural-cosmetics-OG-150x79.jpg\";s:5:\"width\";i:150;s:6:\"height\";i:79;s:9:\"mime-type\";s:10:\"image/jpeg\";}s:6:\"medium\";a:4:{s:4:\"file\";s:48:\"pcc-GreenPuzzle-natural-cosmetics-OG-600x314.jpg\";s:5:\"width\";i:600;s:6:\"height\";i:314;s:9:\"mime-type\";s:10:\"image/jpeg\";}s:12:\"medium_large\";a:4:{s:4:\"file\";s:48:\"pcc-GreenPuzzle-natural-cosmetics-OG-768x402.jpg\";s:5:\"width\";i:768;s:6:\"height\";i:402;s:9:\"mime-type\";s:10:\"image/jpeg\";}s:5:\"large\";a:4:{s:4:\"file\";s:49:\"pcc-GreenPuzzle-natural-cosmetics-OG-1024x536.jpg\";s:5:\"width\";i:1024;s:6:\"height\";i:536;s:9:\"mime-type\";s:10:\"image/jpeg\";}s:14:\"post-thumbnail\";a:4:{s:4:\"file\";s:48:\"pcc-GreenPuzzle-natural-cosmetics-OG-825x510.jpg\";s:5:\"width\";i:825;s:6:\"height\";i:510;s:9:\"mime-type\";s:10:\"image/jpeg\";}s:21:\"woocommerce_thumbnail\";a:5:{s:4:\"file\";s:48:\"pcc-GreenPuzzle-natural-cosmetics-OG-200x105.jpg\";s:5:\"width\";i:200;s:6:\"height\";i:105;s:9:\"mime-type\";s:10:\"image/jpeg\";s:9:\"uncropped\";b:1;}s:18:\"woocommerce_single\";a:4:{s:4:\"file\";s:48:\"pcc-GreenPuzzle-natural-cosmetics-OG-350x183.jpg\";s:5:\"width\";i:350;s:6:\"height\";i:183;s:9:\"mime-type\";s:10:\"image/jpeg\";}s:29:\"woocommerce_gallery_thumbnail\";a:4:{s:4:\"file\