i:245;s:6:\"height\";i:112;s:4:\"file\";s:42:\"2018/10/dostavka_size-—-копия_5.jpg\";s:5:\"sizes\";a:5:{s:9:\"thumbnail\";a:4:{s:4:\"file\";s:41:\"dostavka_size-—-копия_5-150x69.jpg\";s:5:\"width\";i:150;s:6:\"height\";i:69;s:9:\"mime-type\";s:10:\"image/jpeg\";}s:21:\"woocommerce_thumbnail\";a:5:{s:4:\"file\";s:41:\"dostavka_size-—-копия_5-200x91.jpg\";s:5:\"width\";i:200;s:6:\"height\";i:91;s:9:\"mime-type\";s:10:\"image/jpeg\";s:9:\"uncropped\";b:1;}s:29:\"woocommerce_gallery_thumbnail\";a:4:{s:4:\"file\";s:42:\"dostavka_size-—-копия_5-100x100.jpg\";s:5:\"width\";i:100;s:6:\"height\";i:100;s:9:\"mime-type\";s:10:\"image/jpeg\";}s:12:\"shop_catalog\";a:4:{s:4:\"file\";s:41:\"dostavka_size-—-копия_5-200x91.jpg\";s:5:\"width\";i:200;s:6:\"height\";i:91;s:9:\"mime-type\";s:10:\"image/jpeg\";}s:14:\"shop_thumbnail\";a:4:{s:4:\"file\";s:42:\"dostavka_size-—-копия_5-100x100.jpg\";s:5:\"width\";i:100;s:6:\"height\";i:100;s:9:\"mime-type\";s:10:\"image/jpeg\";}}s:10:\"image_meta\";a:12:{s:8:\"aperture\";s:1:\"0\";s:6:\"credit\";s:0:\"\";s:6:\"camera\";s:0:\"\";s:7:\"caption\";s:0:\"\";s:17:\"created_timestamp\";s:1:\"0\";s:9:\"copyright\";s:0:\"\";s:12:\"focal_length\";s:1:\"0\";s:3:\"iso\";s:1:\"0\";s:13:\"shutter_speed\";s:1:\"0\";s:5:\"title\";s:0:\"\";s:11:\"orientation\";s:1:\"1\";s:8:\"keywords\";a:0:{}}}'),(24392,362,'good_show_in_reccomended','1'),(24393,362,'good_excerpt','дневной увлажняющий крем 50 мл'),(24394,362,'good__descr','Дневной увлажняющий крем AlgaPh не просто удерживает влагу, но и заставляет ее работать на кожу. \r\nЕго компоненты притягивают влагу извне, замедляют процесс ее испарения и усиливают защитный барьер эпидермиса.'),(24395,362,'good_logo',''),(24396,362,'good_label','725'),(24397,362,'good_soc_feed_link',''),(24398,362,'good_soc_feed_text',''),(24399,362,'good_soc_feed_img',''),(24400,362,'good_video_link',''),(24401,362,'good_video_text','Видеообзор'),(24402,362,'good_video_img',''),(24403,362,'good_video_preview',''),(24404,362,'tab_bg','321'),(24405,362,'good_tabs_description_tab','Описание'),(24406,362,'good_tabs_description_content','<h4><strong>Правильное увлажнение — залог молодости кожи</strong></h4><h4><strong>Дневной увлажняющий крем ТМ \"Alga Ph\" не просто удерживает влагу,</strong></h4><h4><strong>но и заставляет ее работать на кожу.</strong></h4><p class=\"MsoNormal\"><em>Наша кожа не справляется с самоувлажнением, поскольку мы постоянно устраиваем</em></p><p class=\"MsoNormal\"><em>ей испытания в виде центрального отопления, кондиционирования воздуха,</em></p><p class=\"MsoNormal\"><em>уличной пыли и смога, ветра, перепада низких и высоких температур...</em></p><p class=\"MsoNormal\">Активные ингредиенты в составе увлажняющего крема Alga Ph притягивают влагу</p><p class=\"MsoNormal\">и передают ее клеткам кожи. Также они создают гидрофильную пленку, которая</p><p class=\"MsoNormal\">замедляет процесс испарение влаги и усиливает защитный барьер эпидермиса.</p><p class=\"MsoNormal\">Когда кожа хорошо увлажнена, ее защитные функции повышаются, она легко</p><p class=\"MsoNormal\">справляется с воздействием окружающей среды, выглядит свежей и красивой.</p><p class=\"MsoNormal\"><strong>Результаты:</strong></p><p class=\"MsoNormal\">- кожа более мягкая, гладкая и отдохнувшая – 93%</p><p class=\"MsoNormal\">- кожа выглядит моложе – 71%</p><p class=\"MsoNormal\">- кожа становится боле упругой – 73%</p><p class=\"MsoNormal\">* По результатам потребительского тестирования, подводимого в течении 6 недель</p><p class=\"MsoNormal\">с участием 52 женщин, использовавших Дневной крем Alga Ph.</p><p class=\"MsoNormal\"> </p><p class=\"MsoNormal\"> </p>'),(24407,362,'good_tabs_ingredients_tab','Состав'),(24408,362,'good_tabs_ingredients_content','<p><strong>Соста крема:</strong></p><p>- гидролат алоэ вера</p><p>- OLIVEM 1000</p><p>- масло сливовых косточек</p><p>- масло алоэ</p><p>- масло бораго (огуречника)</p><p>- комбучка</p><p>- глицерин</p><p>- масло ши</p><p>- масло рыжиковое</p><p>- экстракт зеленого чая</p><p>- витамины Е и F</p><p>- Д-пантенол</p><p>- воск карнаубский</p><p>- Euxyl PE 9010</p><p>&nbsp;</p>'),(24409,362,'good_tabs_usage_tab',''),(24410,362,'good_tabs_usage_content','<p><strong>Способ нанесения:</strong></p><p>Крем наносится нежными массажными движениями, на очищенную, слегка влажную кожу лица</p><p>и нижнюю линию шеи, по направлению массажных линий: от центра лица к краям,</p><p>то есть от носа к щекам и от центра лба к вискам. Закончить нанесение крема можно легкими</p><p>похлопывающими движениями.</p><p>Ежедневное использование <strong>Crema Viso Da Giorno</strong> сделает кожу более эластичной и гладкой.</p>'),(24506,366,'good_show_in_reccomended','1'),(24507,366,'good_excerpt','гипоалергенный крем 50 мл'),(24508,366,'good__descr','Использование защитного гипоалергеного крема Crema Protettiva dei Piccoli может стать отличным способом профилактики многих дерматологических симптомов.'),(24509,366,'good_logo',''),(24510,366,'good_label',''),(24511,366,'good_soc_feed_link',''),(24512,366,'good_soc_feed_text',''),(24513,366,'good_soc_feed_img',''),(24514,366,'good_video_link',''),(24515,366,'good_video_text','Видеообзор'),(24516,366,'good_video_img',''),(24517,366,'good_video_preview',''),(24518,366,'tab_bg','331'),(24519,366,'good_tabs_description_tab','Описание'),(24520,366,'good_tabs_description_content','<p align=\"center\"><strong>Крем для самой чувствительной кожи</strong></p><p align=\"center\"><strong>Использование защитного детского крема <span lang=\"EN-US\">Crema</span><span lang=\"EN-US\"> </span><span lang=\"EN-US\">Protettiva</span><span lang=\"EN-US\"> </span><span lang=\"EN-US\">dei</span><span lang=\"EN-US\"> </span><span lang=\"EN-US\">Piccoli</span></strong></p><p align=\"center\"><strong>может стать отличным способом профилактики многих дерматологических симптомов.</strong></p><p><em>Детская кожа нуждается в бережном уходе с первых дней жизни.</em></p><p><em>Правильный выбор косметических средств позволит надёжно защитить ещё неокрепший слой эпидермиса</em></p><p><em>от негативного влияния бактерий и сохранить ее естественную увлажнённость.</em></p><p>Главными функциями, которые выполняет крем является увлажнение и защита кожи малыша</p><p>от воздействия внешних факторов. Крем насыщает эпидермис питательными веществами и влагой,</p><p>восстанавливая и сохраняя их естественный запас. В его состав входят специальные смягчающие кожу</p><p>компоненты на основе природных ингредиентов.</p><p>Благодаря витаминам, минералам и маслам она остаётся гладкой и нежной.</p><p><strong>Результаты:</strong></p><p>- уменьшилось количество покраснений – 97%</p><p>- ранки на коже быстрее заживаются – 85%</p><p>- исчезло раздражение на коже – 88%</p><p>* По результатам потребительского тестирования, подводимого в течении 6 недель</p><p>с участием 52 женщин, которые использовали Защитный детский крем Alga Ph при уходе за кожей дитей.</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>'),(24521,366,'good_tabs_ingredients_tab','Состав'),(24522,366,'good_tabs_ingredients_content','<p><strong>Состав крема:</strong></p><p>- гидролат ромашки</p><p>- масло абрикосовых косточек</p><p>- OLIVEM 1000</p><p>- масло ши</p><p>- масло виноградных косточек</p><p>- Д-пантенол</p><p>- витамин F</p><p>- экстракт календулы</p><p>- Euxyl PE 9010</p><p>&nbsp;</p><p>&nbsp;</p>'),(24523,366,'good_tabs_usage_tab','Применение'),(24524,366,'good_tabs_usage_content','<p><strong>Способ нанесения:</strong></p><p>Крем необходимо нанести тонким слоем на внутреннюю поверхность собственных ладоней,</p><p>после чего дайте ему нагреться 15-20 секунд. Теперь крем можно наносить на лицо и тело ребенка.</p><p>Особое внимание уделите участкам кожи с явными признаками покраснением или шелушением.</p><p>При использовании подгузников, крем <strong><span lang=\"EN-US\">Crema</span> <span lang=\"EN-US\">Protettiva</span> <span lang=\"EN-US\">dei</span> <span lang=\"EN-US\">Piccoli</span></strong> рекомендуется применять ежедневно.</p>'),(24715,364,'good_show_in_reccomended','1'),(24716,364,'good_excerpt','ночной питательный крем 5 мл'),(24717,364,'good__descr','Благодаря своим органическим компонентам, ночной питательный крем Alga Ph, обеспечивает коже максимально здоровое природное питание. \r\nПомимо увлажнения он насыщает кожу минералами, витаминами, аминокислотами и протеинами.'),(24718,364,'good_logo',''),(24719,364,'good_label',''),(24720,364,'good_soc_feed_link',''),(24721,364,'good_soc_feed_text',''),(24722,364,'good_soc_feed_img',''),(24723,364,'good_video_link',''),(24724,364,'good_video_text','Видеообзор'),(24725,364,'good_video_img',''),(24726,364,'good_video_preview',''),(24727,364,'tab_bg','326'),(24728,364,'good_tabs_description_tab','Описание'),(24729,364,'good_tabs_description_content','<p align=\"center\"><strong>Сбалансированное питание залог здоровья кожи</strong></p><p align=\"center\"><strong>Благодаря своим органическим компонентам, ночной питательный крем Alga Ph,</strong></p><p align=\"center\"><strong>обеспечивает коже максимально здоровое природное питание.</strong></p><p><em>В повседневной жизни наша кожа нуждается в правильном сбалансированном питании.</em></p><p><em>Его недостаток часто приводит к шелушению, исчезновению здорового румянца,</em></p><p><em>увяданию и чрезмерной сухости эпидермиса. Особенно ярко это проявляется</em></p><p><em>в зимний период и при смене пор года.</em></p><p>Помимо увлажнения он насыщает кожу минералами, витаминами, аминокислотами и протеинами.</p><p>Также крем защищает кожу от воздействия низких температур (сильного ветра, морозов, снега),</p><p>заживляет ранки и микроповреждения. Кроме того органическая структура крема является</p><p>стимулятором обменных и регенерирующих процессов в клетках кожи.</p><p><strong>Результаты:</strong></p><p>- более здоровый цвет лица – 91%</p><p>- разгладились мелкие морщинки – 68%</p><p>- исчезло раздражение на коже – 74%</p><p>* По результатам потребительского тестирования, подводимого в течении 6 недель </p><p>участием 52 женщин, использовавших Ночной крем Alga Ph.</p><p>&nbsp;</p><p>&nbsp;</p>'),(24730,364,'good_tabs_ingredients_tab','Состав'),(24731,364,'good_tabs_ingredients_content','<p><strong>Состав крема:</strong></p><p>- гидролат черной смородины</p><p>- OLIVEM 1000</p><p>- масло ши</p><p>- масло алоэ</p><p>- масло касторовое</p><p>- масло черной смородины</p><p>- масло примулы вечерней</p><p>- экстракт моркови</p><p>- гидролизат коллагена 50%</p><p>- масло алоэ баттер</p><p>- воск пчелиный</p><p>- комплекс витаминов А, Е, F</p><p>- Д-пантенол</p><p>- Euxyl PE 9010</p><p>&nbsp;</p>'),(24732,364,'good_tabs_usage_tab','Применение'),(24733,364,'good_tabs_usage_content','<p><strong>Способ нанесения:</strong></p><p>Крем наносится нежными массажными движениями, на очищенную, слегка влажную кожу лица</p><p>и нижнюю линию шеи, по направлению массажных линий: от центра лица к краям,</p><p>то есть от носа к щекам и от центра лба к вискам. Закончить нанесение крема можно</p><p>легкими похлопывающими движениями.</p><p>Ежедневное использование <strong><span lang=\"EN-US\">Crema</span> <span lang=\"EN-US\">Viso</span> <span lang=\"EN-US\">Da</span> <span lang=\"EN-US\">Notte</span></strong> придаст коже здоровый внешний вид</p><p>и защитит от пагубного воздействия внешних факторов.</p><p>&nbsp;</p><p>&nbsp;</p>'),(24772,108,'good_show_in_reccomended','1'),(24773,108,'good_excerpt','крем для контура глаз 5 мл'),(24774,108,'good__descr','Крем для контура глаз Alga Ph снимает отечность и убирает темные круги под глазами. Активные компоненты в его составе обеспечивают необходимую защиту, питание и гидратацию нежной коже вокруг глаз.'),(24775,108,'good_logo','787'),(24776,108,'good_label','725'),(24777,108,'good_soc_feed_link','https://www.facebook.com/commerce/products/1577760748922379/'),(24778,108,'good_soc_feed_text','Отзыв'),(24779,108,'good_soc_feed_img','756'),(24780,108,'good_video_link',''),(24781,108,'good_video_text','Видеообзор'),(24782,108,'good_video_img','113'),(24783,108,'good_video_preview','126'),(24784,108,'tab_bg','328'),(24785,108,'good_tabs_description_tab','Описание'),(24786,108,'good_tabs_description_content','<p style=\"text-align: left;\" align=\"center\"><strong>Особый уход для самой нежной зоны лица</strong></p><p style=\"text-align: left;\"><strong>Крем для контура глаз Alga Ph состоит из активных органических ингредиентов,</strong></p><p style=\"text-align: left;\"><strong>которые обеспечивают необходимую защиту, питание и гидратацию.</strong></p><p style=\"text-align: left;\"><em>Нежной коже вокруг глаз требуются специальный уход, поскольку она практически не имеет сальных желез,</em></p><p style=\"text-align: left;\"><em>очень чувствительна и постоянно находится в движении (при моргании, мимике, улыбке).</em></p><p style=\"text-align: left;\"><em>Все это делает ее крайне уязвимой перед возникновением ранних морщин.</em></p><p style=\"text-align: left;\">Благодаря плотной питательной текстуре крем хорошо тонизирует кожу, придает ей мягкость и свежесть</p><p style=\"text-align: left;\">с осветляющим эффектом. В дополнение к этому наличие производных витамина А</p><p style=\"text-align: left;\">стимулируют в коже синтез коллагена, эластина и гиалуроновой кислоты,</p><p style=\"text-align: left;\">что ведет к естественному уменьшению глубины морщин, а также активизирует процесс регенерации клеток.</p><p style=\"text-align: left;\"><strong>Результаты:</strong></p><p style=\"text-align: left;\">- выровнялся тон и текстура кожи – 88%</p><p style=\"text-align: left;\">- увеличилась упругость кожи – 71%</p><p style=\"text-align: left;\">- уменьшилась глубина морщин – 76%</p><p style=\"text-align: left;\">* По результатам потребительского тестирования, подводимого в течении 6 недель</p><p style=\"text-align: left;\">с участием 52 женщин, использовавших Крем для контура глаз Alga Ph.</p><p style=\"text-align: left;\"> </p><p style=\"text-align: left;\"> </p><p style=\"text-align: left;\"> </p>'),(24787,108,'good_tabs_ingredients_tab','Состав'),(24788,108,'good_tabs_ingredients_content','<p style=\"text-align: left;\"><strong>Состав крема:</strong></p><p style=\"text-align: left;\">- гидролат василька</p><p style=\"text-align: left;\">- OLIVEM 1000</p><p style=\"text-align: left;\">- масло сливовых косточек</p><p style=\"text-align: left;\">- масло примулы вечерней</p><p style=\"text-align: left;\">- экстракт зеленого чая</p><p style=\"text-align: left;\">- галоксил</p><p style=\"text-align: left;\">- матриксил 3000</p><p style=\"text-align: left;\">- масло ши</p><p style=\"text-align: left;\">- масло кофе</p><p style=\"text-align: left;\">- масло алоэ</p><p style=\"text-align: left;\">- Euxyl PE 9010</p><p style=\"text-align: left;\"> </p>'),(24789,108,'good_tabs_usage_tab','Применение'),(24790,108,'good_tabs_usage_content','<p style=\"text-align: left;\"><strong>Способ нанесения:</strong></p><p style=\"text-align: left;\">Крем наносится нежными похлопывающими движениями, безымянными пальцами,</p><p style=\"text-align: left;\">по направлению от переносицы по неподвижному верхнему веку, а потом через нижнее веко</p><p style=\"text-align: left;\">обратно к переносице. Никогда не наносите крем на подвижное веко.</p><p style=\"text-align: left;\">Для максимального эффекта используйте <strong>Crema Viso Contorno Occhi</strong> утром и вечером</p><p style=\"text-align: left;\">(минимум за 1 час до сна).</p><p style=\"text-align: left;\"> </p><p style=\"text-align: left;\"> </p><p style=\"text-align: left;\"> </p><p style=\"text-align: left;\"> </p>'),(24979,880,'stock_date','2018-10-24 19:00:00'),(24980,880,'_stock_date','field_5b9767de89615'),(24981,880,'full','866'),(24982,880,'thumb','863'),(24983,880,'full','868'),(24984,880,'thumb','869'),(24985,880,'full','862'),(24986,880,'thumb','865'),(24987,880,'offers_video',''),(24988,880,'offers_video_preview',''),(24989,880,'offers_excerpt','Скидка 20% на весь ассортимент продукции представленной на сайте, при оформлении заказа до 07.10.2018. Акционные цены приурочены ко всемирному дню учителя. Приятных покупок. Будьте красивыми. \r\n\r\nСкидка 20% на весь ассортимент продукции представленной на сайте, при оформлении заказа до 07.10.2018. Акционные цены приурочены ко всемирному дню учителя. Приятных покупок. Будьте красивыми. '),(24990,880,'offers__readmore','Читать далее'),(24991,880,'offers_qty','4'),(24992,1034,'_edit_last','1'),(24993,1034,'discount_type','fixed_cart'),(24994,1034,'coupon_amount','0'),(24995,1034,'individual_use','no'),(24996,1034,'product_ids',''),(24997,1034,'exclude_product_ids',''),(24998,1034,'usage_limit','0'),(24999,1034,'usage_limit_per_user','0'),(25000,1034,'limit_usage_to_x_items','0'),(25001,1034,'usage_count','2'),(25002,1034,'date_expires',NULL),(25003,1034,'expiry_date',''),(25004,1034,'free_shipping','no'),(25005,1034,'product_categories','a:0:{}'),(25006,1034,'exclude_product_categories','a:0:{}'),(25007,1034,'exclude_sale_items','no'),(25008,1034,'minimum_amount',''),(25009,1034,'maximum_amount',''),(25010,1034,'customer_email','a:0:{}'),(25011,1034,'_edit_lock','1540827249:1'),(25062,1034,'_used_by','1'),(25113,1034,'_used_by','1'),(25213,1040,'_form','<div class=\"feedback__wrap\">\n<div class=\"col-1\">\n<p><label><span>Ваше имя*</span>\n[text* feedback-form-name]</label></p>\n<p><label><span>Телефон*</span>\n[text* feedback-form-phone]</label></p>\n<p><label><span>E-Mail*</span>\n[text* feedback-form-email]</label></p>\n</div>\n<div class=\"col-2\">\n<p class=\"textarea__wrap\"><label><span>Сообщение</span>\n[textarea feedback-form-message]</label></p>\n<p class=\"submit__wrap\">[submit \"Отправить\"]</p>\n</div>\n</div>'),(25214,1040,'_mail','a:9:{s:6:\"active\";b:1;s:7:\"subject\";s:36:\"Alga \"Заказать звонок\"\";s:6:\"sender\";s:43:\"[feedback-form-name] <wordpress@algaph.com>\";s:9:\"recipient\";s:25:\"marketingalgaph@gmail.com\";s:4:\"body\";s:263:\"От: [feedback-form-name]\nТема: Заказать звонок\n\nНомер телефона: [feedback-form-phone]\nE-Mail: [feedback-form-email]\