некорректен.\";s:16:\"number_too_small\";s:68:\"Число меньше минимально допустимого.\";s:16:\"number_too_large\";s:70:\"Число больше максимально допустимого.\";s:23:\"quiz_answer_not_correct\";s:69:\"Неверный ответ на проверочный вопрос.\";s:17:\"captcha_not_match\";s:35:\"Код введен неверно.\";s:13:\"invalid_email\";s:62:\"Неверно введён электронный адрес.\";s:11:\"invalid_url\";s:53:\"Введён некорректный URL адрес.\";s:11:\"invalid_tel\";s:70:\"Введён некорректный телефонный номер.\";}'),(25217,1040,'_additional_settings',''),(25218,1040,'_locale','ru_RU'),(25257,107,'good_show_in_reccomended','1'),(25258,107,'good_excerpt','гипоалергенный крем 5 мл'),(25259,107,'good__descr','Гипоаллергенный крем Alga Ph великолепно подойдет для особо чувствительной нежной кожи. Крем быстро заживляет и увлажняет кожу, а его состав дает возможность использоваться крем с первых месяцев жизни. '),(25260,107,'good_logo','787'),(25261,107,'good_label','724'),(25262,107,'good_soc_feed_link',''),(25263,107,'good_soc_feed_text',''),(25264,107,'good_soc_feed_img',''),(25265,107,'good_video_link','https://www.youtube.com/watch?v=Df-Wo48P-M8'),(25266,107,'good_video_text','Видеообзор'),(25267,107,'good_video_img','113'),(25268,107,'good_video_preview','879'),(25269,107,'tab_bg','331'),(25270,107,'good_tabs_description_tab','Описание'),(25271,107,'good_tabs_description_content','<p style=\"text-align: left;\" align=\"center\"><strong>Крем для самой чувствительной кожи</strong></p><p style=\"text-align: left;\" align=\"center\"><strong>Использование защитного детского крема <span lang=\"EN-US\">Crema</span><span lang=\"EN-US\"> </span><span lang=\"EN-US\">Protettiva</span><span lang=\"EN-US\"> </span><span lang=\"EN-US\">dei</span><span lang=\"EN-US\"> </span><span lang=\"EN-US\">Piccoli</span></strong></p><p style=\"text-align: left;\" align=\"center\"><strong>может стать отличным способом профилактики многих дерматологических симптомов.</strong></p><p style=\"text-align: left;\"><em>Детская кожа нуждается в бережном уходе с первых дней жизни.</em></p><p style=\"text-align: left;\"><em>Правильный выбор косметических средств позволит надёжно защитить ещё неокрепший слой эпидермиса</em></p><p style=\"text-align: left;\"><em>от негативного влияния бактерий и сохранить ее естественную увлажнённость.</em></p><p style=\"text-align: left;\">Главными функциями, которые выполняет крем является увлажнение и защита кожи малыша</p><p style=\"text-align: left;\">от воздействия внешних факторов. Крем насыщает эпидермис питательными веществами и влагой,</p><p style=\"text-align: left;\">восстанавливая и сохраняя их естественный запас. В его состав входят специальные смягчающие кожу</p><p style=\"text-align: left;\">компоненты на основе природных ингредиентов.</p><p style=\"text-align: left;\">Благодаря витаминам, минералам и маслам она остаётся гладкой и нежной.</p><p style=\"text-align: left;\"><strong>Результаты:</strong></p><p style=\"text-align: left;\">- уменьшилось количество покраснений – 97%</p><p style=\"text-align: left;\">- ранки на коже быстрее заживаются – 85%</p><p style=\"text-align: left;\">- исчезло раздражение на коже – 88%</p><p style=\"text-align: left;\">* По результатам потребительского тестирования, подводимого в течении 6 недель</p><p style=\"text-align: left;\">с участием 52 женщин, которые использовали Защитный детский крем Alga Ph при уходе за кожей дитей.</p><p style=\"text-align: left;\"> </p><p style=\"text-align: left;\"> </p><p style=\"text-align: left;\"> </p><p style=\"text-align: left;\"> </p>'),(25272,107,'good_tabs_ingredients_tab','Состав'),(25273,107,'good_tabs_ingredients_content','<p style=\"text-align: left;\"><strong>Состав крема:</strong></p><p style=\"text-align: left;\">- гидролат ромашки</p><p style=\"text-align: left;\">- масло абрикосовых косточек</p><p style=\"text-align: left;\">- OLIVEM 1000</p><p style=\"text-align: left;\">- масло ши</p><p style=\"text-align: left;\">- масло виноградных косточек</p><p style=\"text-align: left;\">- Д-пантенол</p><p style=\"text-align: left;\">- витамин F</p><p style=\"text-align: left;\">- экстракт календулы</p><p style=\"text-align: left;\">- Euxyl PE 9010</p><p style=\"text-align: left;\"> </p><p style=\"text-align: left;\"> </p><p style=\"text-align: left;\"> </p>'),(25274,107,'good_tabs_usage_tab','Применение'),(25275,107,'good_tabs_usage_content','<p><strong>Способ нанесения:</strong></p><p>Крем необходимо нанести тонким слоем на внутреннюю поверхность собственных ладоней,</p><p>после чего дайте ему нагреться 15-20 секунд. Теперь крем можно наносить на лицо и тело ребенка.</p><p>Особое внимание уделите участкам кожи с явными признаками покраснением или шелушением.</p><p>При использовании подгузников, крем <strong><span lang=\"EN-US\">Crema</span> <span lang=\"EN-US\">Protettiva</span> <span lang=\"EN-US\">dei</span> <span lang=\"EN-US\">Piccoli</span></strong> рекомендуется применять ежедневно.</p>'),(25277,152,'movie_show_homepage','1'),(25278,152,'movie_title','О компании Alga Ph'),(25279,152,'movie_link','https://www.youtube.com/watch?v=hD5vxRg8P_I'),(25280,152,'movie_img','739'),(25281,1042,'_edit_lock','1540891900:1'),(25282,1042,'_edit_last','1'),(25283,1043,'_wp_attached_file','2018/10/video_size_2.jpg'),(25284,1043,'_wp_attachment_metadata','a:5:{s:5:\"width\";i:978;s:6:\"height\";i:550;s:4:\"file\";s:24:\"2018/10/video_size_2.jpg\";s:5:\"sizes\";a:10:{s:9:\"thumbnail\";a:4:{s:4:\"file\";s:23:\"video_size_2-150x84.jpg\";s:5:\"width\";i:150;s:6:\"height\";i:84;s:9:\"mime-type\";s:10:\"image/jpeg\";}s:6:\"medium\";a:4:{s:4:\"file\";s:24:\"video_size_2-600x337.jpg\";s:5:\"width\";i:600;s:6:\"height\";i:337;s:9:\"mime-type\";s:10:\"image/jpeg\";}s:12:\"medium_large\";a:4:{s:4:\"file\";s:24:\"video_size_2-768x432.jpg\";s:5:\"width\";i:768;s:6:\"height\";i:432;s:9:\"mime-type\";s:10:\"image/jpeg\";}s:14:\"post-thumbnail\";a:4:{s:4:\"file\";s:24:\"video_size_2-825x510.jpg\";s:5:\"width\";i:825;s:6:\"height\";i:510;s:9:\"mime-type\";s:10