INSERT INTO `wp_posts` VALUES (6,1,'2018-07-24 13:30:28','2018-07-24 13:30:28','','Главная','','publish','closed','closed','','%d0%b3%d0%bb%d0%b0%d0%b2%d0%bd%d0%b0%d1%8f','','','2018-12-11 19:44:34','2018-12-11 19:44:34','',0,'http://algaph.com/?page_id=6',0,'page','',0),(7,1,'2018-07-24 13:30:28','2018-07-24 13:30:28','','Главная','','inherit','closed','closed','','6-revision-v1','','','2018-07-24 13:30:28','2018-07-24 13:30:28','',6,'http://algaph.com/?p=7',0,'revision','',0),(8,1,'2018-07-24 14:51:17','2018-07-24 14:51:17','<h2 style=\"text-align: center;\"><span style=\"color: #5edb1a;\"><strong>Бесплатная доставка при заказе на сумму от 299 грн!</strong></span></h2>\r\n<strong style=\"font-size: 10pt;\"><img class=\"size-full wp-image-794 aligncenter\" src=\"http://algaph.com/wp-content/uploads/2018/09/samovuvoz-01-1.jpg\" alt=\"\" width=\"177\" height=\"112\" /></strong>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 10pt;\"><strong><span style=\"font-size: 14pt;\">Самовывоз товара из ближайшего пункта выдачи</span>\r\n</strong></span><span style=\"font-size: 14pt;\">Оформить заказ можно на нашем сайте и забрать свою покупку в ближайшем пункте выдачи.\r\n<em>С перечнем пунктов выдачи можно ознакомиться в разделе <a href=\"http://algaph.com/contacts/\">контакты</a></em><em>.</em><strong><em>\r\n</em></strong>При оформлении заказа оператор контакт-центра уточняет удобное для Вас место и время приезда за покупкой.\r\nДоставка товара в пункт выдачи по Вашему заказу осуществляется бесплатно.</span></p>\r\n\r\n\r\n<hr />\r\n<p style=\"text-align: left;\"><span style=\"font-size: 10pt;\"><strong><span style=\"font-size: 14pt;\">\r\n<img class=\"size-full wp-image-801 aligncenter\" src=\"http://algaph.com/wp-content/uploads/2018/09/novaya_pochta.jpg\" alt=\"\" width=\"177\" height=\"112\" />До отделения «Нова пошта»</span>\r\n</strong></span><span style=\"font-size: 14pt;\">Сроки доставки в ближайшее к вам отделение «Нова пошта» 1 - 3 дня.</span>\r\n<span style=\"font-size: 14pt;\">После отправки заказа вы получите SMS-сообщение с номером экспресс-накладной.</span>\r\n<span style=\"font-size: 14pt;\">Уточнить конкретную дату получения вашего заказа вы можете на сайте компании «Нова пошта».</span>\r\n<span style=\"font-size: 14pt;\">Единая стоимость доставки в любое отделение «Нова пошта» — 25 грн.</span></p>\r\n&nbsp;\r\n\r\n<hr />\r\n<p style=\"text-align: left;\"><span style=\"font-size: 10pt;\"><strong>\r\n<img class=\"size-full wp-image-806 aligncenter\" src=\"http://algaph.com/wp-content/uploads/2018/09/dostavka.jpg\" alt=\"\" width=\"177\" height=\"112\" /><span style=\"font-size: 14pt;\">Адресная доставка по Киеву</span></strong></span>\r\n<span style=\"font-size: 14pt;\">Адресная доставка заказов по Киеву осуществляется с понедельника по субботу с 09:00 до 19:00.</span>\r\n<span style=\"font-size: 14pt;\">При наличии товара на складе и оформлении заказа до 12.00 доставка происходит в день оформления заказа.</span>\r\n<span style=\"font-size: 14pt;\">Если заказ оформлен после 12.00 - доставка курьером осуществляется на следующий день.</span>\r\n<span style=\"font-size: 14pt;\">Если заказ оформлен в воскресенье, доставка производится в понедельник.\r\n</span><span style=\"font-size: 14pt;\">Единая стоимость адресной доставки в любую точку Киева — 50 грн.</span></p>\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;','Доставка и оплата','','publish','closed','closed','','shipping','','','2018-10-26 12:56:26','2018-10-26 12:56:26','',0,'http://algaph.com/?page_id=8',0,'page','',0),(9,1,'2018-07-24 14:51:17','2018-07-24 14:51:17','','Доставка и оплата','','inherit','closed','closed','','8-revision-v1','','','2018-07-24 14:51:17','2018-07-24 14:51:17','',8,'http://algaph.com/?p=9',0,'revision','',0),(10,1,'2018-07-24 14:51:41','2018-07-24 14:51:41','<h1 style=\"text-align: center;\">Если вам нужен успешный бизнес,</h1>\r\n<h1 style=\"text-align: center;\">а не единичные продажи – значит вам нужен надежный партнер.</h1>\r\n<h3 style=\"text-align: center;\"><span style=\"color: #000000;\">Мы предлагаем вам надежное и долгосрочное сотрудничество.\r\n</span><span style=\"color: #000000;\">Мы предлагаем вам наладить бизнес с качественным товаром</span>\r\n<span style=\"color: #000000;\">на выгодных условиях, а не единожды продать.\r\n</span><span style=\"color: #000000;\">Мы предлагаем вам быть лидером!</span></h3>\r\n<p style=\"text-align: center;\"><img class=\"size-full wp-image-679 aligncenter\" src=\"http://algaph.com/wp-content/uploads/2018/09/sotrudnichestvo.png\" alt=\"\" width=\"1024\" height=\"325\" /></p>\r\n<div class=\"contacts__formInner\">\r\n  <div class=\"contacts__form\">\r\n    [contact-form-7 id=\"1040\" title=\"Форма обратной связи\"]\r\n  </div>\r\n  <div class=\"contacts__info\">\r\n    <div class=\"contacts__infoTitle\">Приглашаем<br> на чашечку кофе!</div>\r\n    <div class=\"contacts__infoContent\">\r\n      <p>С удовольствием обсудим все интересующие вас вопросы в нашем главном офисе за чашечкой кофе.</p>\r\n      <p>\r\n         <div>г.Киев, пл.Спортивная 1 А</div>\r\n         <div>Моб.: +38 099 7 234 654</div>\r\n         <div>Email: marketing@algaph.com</div>\r\n         <div>www.algaph.com</div>\r\n      </p>\r\n    </div>\r\n  </div>\r\n</div>','Условия сотрудничества','','publish','closed','closed','','terms-cooperation','','','2018-10-30 10:11:32','2018-10-30 10:11:32','',0,'http://algaph.com/?page_id=10',0,'page','',0),(11,1,'2018-07-24 14:51:41','2018-07-24 14:51:41','','Условия сотрудничества','','inherit','closed','closed','','10-revision-v1','','','2018-07-24 14:51:41','2018-07-24 14:51:41','',10,'http://algaph.com/?p=11',0,'revision','',0),(12,1,'2018-07-24 14:52:47','2018-07-24 14:52:47',' ','','','publish','closed','closed','','12','','','2018-07-24 14:52:47','2018-07-24 14:52:47','',0,'http://algaph.com/?p=12',1,'nav_menu_item','',0),(13,1,'2018-07-24 14:52:47','2018-07-24 14:52:47',' ','','','publish','closed','closed','','13','','','2018-07-24 14:52:47','2018-07-24 14:52:47','',0,'http://algaph.com/?p=13',2,'nav_menu_item','',0),(14,1,'2018-07-24 14:54:27','2018-07-24 14:54:27','<p style=\"text-align: right;\"><em><span style=\"font-size: 14pt;\">“Мы семейная компания, которая сохраняет вековые традиции итальянской фармацевтики...”\r\n</span></em><span style=\"font-size: 14pt;\"><em><strong>Al</strong>berto<strong> Ga</strong>lasi (основатель)</em></span></p>\r\n<span style=\"font-size: 14pt;\">Компания была основана в 1917 году, в Милане (Италия), и по сей день специализируется на производстве органической косметики.</span>\r\n\r\n<span style=\"font-size: 14pt;\">На сегодняшний момент в распоряжении компании:</span>\r\n<span style=\"font-size: 14pt;\">- опыт 4 поколений фармацевтов;</span>\r\n<span style=\"font-size: 14pt;\">- собственное производство;</span>\r\n<span style=\"font-size: 14pt;\">- квалифицированный персонал;</span>\r\n<span style=\"font-size: 14pt;\">- современная лаборатория...</span>\r\n\r\n<span style=\"font-size: 14pt;\">В Украине, продукция компании была впервые представлена в 2017 году серией органической косметики для лица под ТМ «Alga Ph».</span>\r\n\r\n<span style=\"font-size: 14pt;\">Сейчас это едва ли не единственная косметика на отечественном рынке, которая соответствует требованиям «Ecocert» и «BDIH», которые сертифицируют косметические средства, имеющие в своем составе 95 и более процентов натуральных ингредиентов растительного происхождения.</span><span style=\"font-size: 14pt;\"><img class=\"size-full wp-image-828 aligncenter\" src=\"http://algaph.com/wp-content/uploads/2018/10/o_kosmetike_3.jpg\" alt=\"\" width=\"1245\" height=\"420\" /></span>\r\n\r\n<span style=\"font-size: 14pt;\"> </span>','О косметике','','publish','closed','closed','','about-cosmetics','','','2018-10-01 12:12:55','2018-10-01 12:12:55','',0,'http://algaph.com/?page_id=14',0,'page','',0),(15,1,'2018-07-24 14:54:27','2018-07-24 14:54:27','','О косметике','','inherit','closed','closed','','14-r