2:50:47','2018-10-26 12:50:47','<h2 style=\"text-align: center;\"><span style=\"color: #5edb1a;\"><strong>Бесплатная доставка при заказе на сумму от 299 грн!</strong></span></h2>\n<p style=\"text-align: left;\"></p>\n&nbsp;\n<p style=\"text-align: left;\"><span style=\"font-size: 10pt;\"><strong><img class=\"size-full wp-image-794 alignleft\" src=\"http://algaph.com/wp-content/uploads/2018/09/samovuvoz-01-1.jpg\" alt=\"\" width=\"177\" height=\"112\" /><span style=\"font-size: 14pt;\">Самовывоз товара из ближайшего пункта выдачи</span>\n</strong></span><span style=\"font-size: 14pt;\">Оформить заказ можно на нашем сайте и забрать свою покупку в ближайшем пункте выдачи.\n<em>С перечнем пунктов выдачи можно ознакомиться в разделе <a href=\"http://algaph.com/contacts/\">контакты</a></em><em>.</em><strong><em>\n</em></strong>При оформлении заказа оператор контакт-центра уточняет удобное для Вас место и время приезда за покупкой.\nДоставка товара в пункт выдачи по Вашему заказу осуществляется бесплатно.</span></p>\n\n\n<hr />\n<p style=\"text-align: left;\"><span style=\"font-size: 10pt;\"><strong><span style=\"font-size: 14pt;\">\n<img class=\"size-full wp-image-801 alignleft\" src=\"http://algaph.com/wp-content/uploads/2018/09/novaya_pochta.jpg\" alt=\"\" width=\"177\" height=\"112\" />До отделения «Нова пошта»</span>\n</strong></span><span style=\"font-size: 14pt;\">Сроки доставки в ближайшее к вам отделение «Нова пошта» 1 - 3 дня.</span>\n<span style=\"font-size: 14pt;\">После отправки заказа вы получите SMS-сообщение с номером экспресс-накладной.</span>\n<span style=\"font-size: 14pt;\">Уточнить конкретную дату получения вашего заказа вы можете на сайте компании «Нова пошта».</span>\n<span style=\"font-size: 14pt;\">Единая стоимость доставки в любое отделение «Нова пошта» — 25 грн.</span></p>\n&nbsp;\n\n<hr />\n<p style=\"text-align: left;\"><span style=\"font-size: 10pt;\"><strong>\n<img class=\"size-full wp-image-806 alignleft\" src=\"http://algaph.com/wp-content/uploads/2018/09/dostavka.jpg\" alt=\"\" width=\"177\" height=\"112\" /><span style=\"font-size: 14pt;\">Адресная доставка по Киеву</span></strong></span>\n<span style=\"font-size: 14pt;\">Адресная доставка заказов по Киеву осуществляется с понедельника по субботу с 09:00 до 19:00.</span>\n<span style=\"font-size: 14pt;\">При наличии товара на складе и оформлении заказа до 12.00 доставка происходит в день оформления заказа.</span>\n<span style=\"font-size: 14pt;\">Если заказ оформлен после 12.00 - доставка курьером осуществляется на следующий день.</span>\n<span style=\"font-size: 14pt;\">Если заказ оформлен в воскресенье, доставка производится в понедельник.\n</span><span style=\"font-size: 14pt;\">Единая стоимость адресной доставки в любую точку Киева — 50 грн.</span></p>\n&nbsp;\n\n&nbsp;\n\n&nbsp;\n\n&nbsp;','Доставка и оплата','','inherit','closed','closed','','8-autosave-v1','','','2018-10-26 12:50:47','2018-10-26 12:50:47','',8,'http://algaph.com/8-autosave-v1/',0,'revision','',0),(479,1,'2018-08-30 11:15:07','2018-08-30 11:15:07','1. Самовывоз товара из ближайшего пункта выдачи.\r\nВы имеете возможность оформить заказ на интересующий Вас товар на нашем сайте и забрать свою покупку в ближайшем пункте выдачи.\r\nПри оформлении заказа оператор контакт-центра уточняет удобное для Вас место и время приезда за покупкой. Доставка товара в пункт выдачи по Вашему заказу осуществляется бесплатно.','Доставка и оплата','','inherit','closed','closed','','8-revision-v1','','','2018-08-30 11:15:07','2018-08-30 11:15:07','',8,'http://algaph.com/8-revision-v1/',0,'revision','',0),(480,1,'2018-08-30 11:15:57','2018-08-30 11:15:57','1. Самовывоз товара из ближайшего пункта выдачи.\r\nВы имеете возможность оформить заказ на интересующий Вас товар на нашем сайте и забрать свою покупку в ближайшем пункте выдачи.\r\nПри оформлении заказа оператор контакт-центра уточняет удобное для Вас место и время приезда за покупкой.\r\nДоставка товара в пункт выдачи по Вашему заказу осуществляе