01.png\" alt=\"\" width=\"177\" height=\"133\" />Самовывоз товара из ближайшего пункта выдачи </strong></span><span style=\"font-size: 10pt;\">Вы имеете возможность оформить заказ на интересующий Вас товар на вашем сайте и забрать свою покупку в ближайшем пункте выдачи. При оформлении заказа оператор контакт-центра уточняет удобное для Вас место и время приезда за покупкой. Доставка товара в пункт выдачи по Вашему заказу осуществляется бесплатно.</span>\r\n\r\n<hr />\r\n\r\n<span style=\"font-size: 10pt;\"><strong><img class=\"size-full wp-image-673 alignleft\" src=\"http://algaph.com/wp-content/uploads/2018/09/novapochta_2-02.png\" alt=\"\" width=\"177\" height=\"133\" />До отделения «Нова пошта»</strong></span>\r\n<span style=\"font-size: 10pt;\">Сроки доставки в ближайшее к вам отделение «Нова пошта» 1 - 3 дня.</span>\r\n<span style=\"font-size: 10pt;\">После отправки заказа вы получите SMS-сообщение с номером экспресс-накладной.</span>\r\n<span style=\"font-size: 10pt;\">Уточнить конкретную дату получения вашего заказа вы можете на сайте компании «Нова пошта».</span>\r\n<span style=\"font-size: 10pt;\">Единая стоимость доставки в любое отделение «Нова пошта» — 25 грн.</span>\r\n\r\n<hr />\r\n\r\n<span style=\"font-size: 10pt;\"><strong><img class=\"size-full wp-image-677 aligncenter\" src=\"http://algaph.com/wp-content/uploads/2018/09/adresnayadostavka-03.png\" alt=\"\" width=\"177\" height=\"133\" />Адресная доставка по Киеву</strong></span>\r\n<span style=\"font-size: 10pt;\">Адресная доставка заказов по Киеву осуществляется с понедельника по субботу с 09:00 до 19:00.</span>\r\n<span style=\"font-size: 10pt;\">При наличии товара на складе и оформлении заказа до 12.00 доставка происходит в день оформления заказа, кроме воскресенья.</span>\r\n<span style=\"font-size: 10pt;\">Если заказ оформлен после 12.00 - доставка курьером осуществляется на следующий день.</span>\r\n<span style=\"font-size: 10pt;\">Если заказ оформлен в воскресенье, доставка производится в понедельник.</span>\r\n<span style=\"font-size: 10pt;\">Оператор контакт-центра уточняет наличие товара по Вашему заказу, согласовывает с Вами адрес, удобную дату и время доставки.</span>\r\n<span style=\"font-size: 10pt;\">Единая стоимость адресной доставки в любую точку Киева — 50 грн.</span>','Доставка и оплата','','inherit','closed','closed','','8-revision-v1','','','2018-09-24 10:45:12','2018-09-24 10:45:12','',8,'http://algaph.com/8-revision-v1/',0,'revision','',0),(680,1,'2018-09-24 10:51:24','2018-09-24 10:51:24','<h1 style=\"text-align: center;\">Если вам нужен успешный бизнес,</h1>\r\n<h1 style=\"text-align: center;\">а не единичные продажи – значит вам нужен надежный партнер.</h1>\r\n<h3 style=\"text-align: center;\"><span style=\"color: #000000;\">Мы предлагаем вам надежное и долгосрочное сотрудничество.\r\n</span><span style=\"color: #000000;\">Мы предлагаем вам наладить бизнес с качественным товаром</span>\r\n<span style=\"color: #000000;\">на выгодных условиях, а не единожды продать.\r\n</span><span style=\"color: #000000;\">Мы предлагаем вам быть лидером!</span></h3>\r\n<img class=\"alignnone size-full wp-image-679\" src=\"http://algaph.com/wp-content/uploads/2018/09/sotrudnichestvo.png\" alt=\"\" width=\"1024\" height=\"325\" />','Условия сотрудничества','','inherit','closed','closed','','10-revision-v1','','','2018-09-24 10:51:24','2018-09-24 10:51:24','',10,'http://algaph.com/10-revision-v1/',0,'revision','',0),(681,1,'2018-09-24 10:51:45','2018-09-24 10:51:45','<h1 style=\"text-align: center;\">Если вам нужен успешный бизнес,</h1>\r\n<h1 style=\"text-align: center;\">а не единичные продажи – значит вам нужен надежный партнер.</h1>\r\n<h3 style=\"text-align: center;\"><span style=\"color: #000000;\">Мы предлагаем вам надежное и долгосрочное сотрудничество.\r\n</span><span style=\"color: #000000;\">Мы предлагаем вам наладить бизнес с качественным товаром</span>\r\n<span style=\"color: #000000;\">на выгодных условиях, а не единожды продать.\r\n</span>