 11:54:27','2018-09-24 11:54:27','<p style=\"text-align: right;\"><span style=\"font-size: 14pt;\"><em>“Мы семейная компания, которая сохраняет вековые традиции итальянской фармацевтики...”\r\n<strong>Alberto Galasi <span style=\"font-size: 13.5pt;\">(основатель)</span></strong>\r\n</em></span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 14pt;\">Компания была основана в 1917 году, в Милане (Италия), и по сей день специализируется на производстве органической косметики.</span></p>\r\n<strong><span style=\"font-size: 14pt;\">На сегодняшний момент в распоряжении компании:</span></strong>\r\n\r\n<span style=\"font-size: 14pt;\">- опыт 4 поколений фармацевтов;\r\n</span><span style=\"font-size: 14pt;\">- собственное производство;\r\n</span><span style=\"font-size: 14pt;\">- квалифицированный персонал;\r\n</span><span style=\"font-size: 14pt;\">- современная лаборатория...</span>\r\n\r\n<span style=\"font-size: 14pt;\">В Украине, продукция компании была впервые представлена в 2017 году серией органической косметики для лица под ТМ «Alga Ph».\r\n\r\n</span><span style=\"font-size: 14pt;\">Сейчас это едва ли не единственная косметика на отечественном рынке, которая соответствует требованиям «Ecocert» и «BDIH», которые сертифицируют косметические средства, имеющие в своем составе 95 и более процентов натуральных ингредиентов растительного происхождения.</span>','О косметике','','inherit','closed','closed','','14-revision-v1','','','2018-09-24 11:54:27','2018-09-24 11:54:27','',14,'http://algaph.com/14-revision-v1/',0,'revision','',0),(695,1,'2018-09-24 11:55:28','2018-09-24 11:55:28','<h2 style=\"text-align: center;\"><span style=\"color: #5edb1a;\"><strong>Бесплатная доставка при заказе на сумму от 299 грн!</strong></span></h2>\r\n<span style=\"font-size: 10pt;\"><strong>\r\n<img class=\"size-full wp-image-657 alignright\" src=\"http://algaph.com/wp-content/uploads/2018/09/samovuvoz_3-01.png\" alt=\"\" width=\"177\" height=\"133\" />Самовывоз товара из ближайшего пункта выдачи </strong></span><span style=\"font-size: 10pt;\">Вы имеете возможность оформить заказ на интересующий Вас товар на вашем сайте и забрать свою покупку в ближайшем пункте выдачи. При оформлении заказа оператор контакт-центра уточняет удобное для Вас место и время приезда за покупкой. Доставка товара в пункт выдачи по Вашему заказу осуществляется бесплатно.</span>\r\n\r\n<hr />\r\n\r\n<span style=\"font-size: 10pt;\"><strong><img class=\"size-full wp-image-673 alignleft\" src=\"http://algaph.com/wp-content/uploads/2018/09/novapochta_2-02.png\" alt=\"\" width=\"177\" height=\"133\" />До отделения «Нова пошта»</strong></span>\r\n<span style=\"font-size: 10pt;\">Сроки доставки в ближайшее к вам отделение «Нова пошта» 1 - 3 дня.</span>\r\n<span style=\"font-size: 10pt;\">После отправки заказа вы получите SMS-сообщение с номером экспресс-накладной.</span>\r\n<span style=\"font-size: 10pt;\">Уточнить конкретную дату получения вашего заказа вы можете на сайте компании «Нова пошта».</span>\r\n<span style=\"font-size: 10pt;\">Единая стоимость доставки в любое отделение «Нова пошта» — 25 грн.</span>\r\n\r\n<hr />\r\n\r\n<span style=\"font-size: 10pt;\"><strong><img class=\"size-full wp-image-677 aligncenter\" src=\"http://algaph.com/wp-content/uploads/2018/09/adresnayadostavka-03.png\" alt=\"\" width=\"177\" height=\"133\" />Адресная доставка по Киеву</strong></span>\r\n<span style=\"font-size: 10pt;\">Адресная доставка заказов по Киеву осуществляется с понедельника по субботу с 09:00 до 19:00.</span>\r\n<span style=\"font-size: 10pt;\">При наличии товара на складе и оформлении заказа до 12.00 доставка происходит в день оформления заказа, кроме воскресенья.\r\n</span>\r\n<span style=\"font-size: 10pt;\">Если заказ оформлен после 12.00 - доставка курьером осуществляется на следующий день.</span>\r\n<span style=\"font-size: 10pt;\">Если заказ оформлен в воскресенье, доставка производится в понедельник.</span>\r\n<span style=\"font-size: 10pt;\">Оператор контакт-центра уточняет наличие товара по Вашему заказу, согласовывает с Вами адрес, удобную дату и время доставки.</span>\r\n<span style=\"font-size: 10pt;\">Единая стоимость адресной доставки в любую точку Киева — 50 грн.</span>','Доставка и оплата','','inherit','closed','closed','','8-revision-v1','','','2018-09-24 11:55:28','2018-09-24 11:55:28','',8,'http://algaph.com/8-revision-v1/',0,'revision','',0),(696,1,'2018-09-24 11:56:18','2018-09-24 11:56:18','<p style=\"text-align: right;\"><span style=\"font-size: 14pt;\"><em>“Мы семейная компания, которая сохраняет вековые традиции итальянской фармацевтики...”\r\n<strong>Alberto Galasi (основатель)</strong>\r\n</em></span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 14pt;\">Компания была основана в 1917 году, в Милане (Италия), и по сей день специализируется на производстве органической косметики.</span></p>\r\n<span style=\"font-size: 14pt;\"><strong>На сегодняшний момент в распоряжении компании:</strong></span>\r\n\r\n<span style=\"font-size: 14pt;\">- опыт 4 поколений фармацевтов;\r\n- собственное производство;\r\n- квалифицированный персонал;\r\n- современная лаборатория...</span>\r\n\r\n<span style=\"font-size: 14pt;\">В Украине, продукция компании была впервые представлена в 2017 году серией органической косметики для лица под ТМ «Alga Ph».</span>\r\n\r\n<span style=\"font-size: 14pt;\">Сейчас это едва ли не единственная косметика на отечественном рынке, которая соответствует требованиям «Ecocert» и «BDIH», которые сертифицируют косметические средства, имеющие в своем составе 95 и более процентов натуральных ингредиентов растительного происхождения.</span>','О косметике','','inherit','closed','closed','','14-revision-v1','','','2018-09-24 11:56:18','2018-09-24 11:56:18','',14,'http://algaph.com/14-revision-v1/',0,'revision','',0),(697,1,'2018-09-24 11:56:44','2018-09-24 11:56:44','<p style=\"text-align: right;\"><span style=\"font-size: 14pt;\"><em>“Мы семейная компания, которая сохраняет веков