у получения вашего заказа вы можете на сайте компании «Нова пошта».</span>\r\n<span style=\"font-size: 10pt;\">Единая стоимость доставки в любое отделение «Нова пошта» — 25 грн.</span>\r\n\r\n<hr />\r\n\r\n<span style=\"font-size: 10pt;\"><strong><img class=\"size-full wp-image-677 alignleft\" src=\"http://algaph.com/wp-content/uploads/2018/09/adresnayadostavka-03.png\" alt=\"\" width=\"177\" height=\"133\" />Адресная доставка по Киеву</strong></span>\r\n<span style=\"font-size: 10pt;\">Адресная доставка заказов по Киеву осуществляется с понедельника по субботу с 09:00 до 19:00.</span>\r\n<span style=\"font-size: 10pt;\">При наличии товара на складе и оформлении заказа до 12.00 доставка происходит в день оформления заказа, кроме воскресенья.\r\n</span>\r\n<span style=\"font-size: 10pt;\">Если заказ оформлен после 12.00 - доставка курьером осуществляется на следующий день.</span>\r\n<span style=\"font-size: 10pt;\">Если заказ оформлен в воскресенье, доставка производится в понедельник.</span>\r\n<span style=\"font-size: 10pt;\">Оператор контакт-центра уточняет наличие товара по Вашему заказу, согласовывает с Вами адрес, удобную дату и время доставки.</span>\r\n<span style=\"font-size: 10pt;\">Единая стоимость адресной доставки в любую точку Киева — 50 грн.</span>','Доставка и оплата','','inherit','closed','closed','','8-revision-v1','','','2018-09-27 10:27:16','2018-09-27 10:27:16','',8,'http://algaph.com/8-revision-v1/',0,'revision','',0),(789,1,'2018-09-27 10:27:47','2018-09-27 10:27:47','<h2 style=\"text-align: center;\"><span style=\"color: #5edb1a;\"><strong>Бесплатная доставка при заказе на сумму от 299 грн!</strong></span></h2>\r\n<span style=\"font-size: 10pt;\"><strong>\r\n<img class=\"size-full wp-image-657 alignleft\" src=\"http://algaph.com/wp-content/uploads/2018/09/samovuvoz_3-01.png\" alt=\"\" width=\"177\" height=\"133\" />Самовывоз товара из ближайшего пункта выдачи\r\n</strong></span><span style=\"font-size: 10pt;\">Вы имеете возможность оформить за